import { useState, useEffect } from "react";
import Color from "./Color";
function ColorList({ gameColors }) {
  console.log(gameColors);
  return (
    <div>
      {gameColors.map((color, index) => (
        <div key={index}>
        <Color color={color} />
        </div>
      ))}
    </div>
  );
}

export default ColorList;
